import React from "react";

export default function OutputBox({ sql, result }) {
  return (
    <div style={{ marginTop: "20px" }}>
      <h3>Generated SQL:</h3>
      <pre>{sql}</pre>
      <h3>Result:</h3>
      <pre>{JSON.stringify(result, null, 2)}</pre>
    </div>
  );
}
